script: |
  super -f text -I q3532.spq | sort > q3532.out

inputs:
  - name: q3532.spq
    data: |
      SELECT ALL + 47 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( 56 ) BETWEEN ( + CAST ( NULL AS INTEGER ) ) AND - col0;
  - name: tab2

outputs:
  - name: q3532.out
    data: |
      47
      47
      47
